    DescribeDomainCount(query: DescribeDomainCountRequest): Promise<DescribeDomainCountResponse>;
    /**
     * 查询您的域名资产的详情。
     */
    DescribeDomainDetail(query: DescribeDomainDetailRequest): Promise<DescribeDomainDetailResponse>;
